import React from "react"
import { Component } from "react"

class App extends Component{

    constructor() {
        super()
        this.logged = {
            isLoggedIn: false
        }
    }

    render(){

        let state

        if (this.logged.login == false) {
            state = "OUT"
        } else {
            state = "IN"
        }

        return(
            <div>
                <h1>You are currently logged {state}</h1>
            </div>
        )
    }
}

export default App
